import React, {Component} from 'react';
import CardList from './CardList';
import {robots} from './Robots';
import Seacrhbox from './Searchbox';
import 'tachyons';

class App extends Component {

	constructor()
	{
		super()
		this.state = 
		{
			robots : robots,
			searchField: "",
		}
	}
	render(){
		return(
		<div className='tc'>
			<h1> Robots </h1>
			<Seacrhbox />
			<CardList robots={robots}/>
		</div>
	);

	}
}



export default App;
